INSERT INTO `childrens` VALUES (7,8,'မောင်လင်းခန့် အောင်',136,1,1,'မန္တလေး','','အခန်း(၂၀၆)၊ စိမ်းလဲ့မေလမ်းသွယ်၊ DICA၊ ရန်ကုန်တိုင်း ဝန်ထမ်းအိမ်ရာ၊ ရန်ကင်းမြို့နယ်',3,'2024-12-08 22:37:55','2024-12-08 22:37:55'),(34,7,'မပိုးဥသန့်စင်',86,1,2,'ရန်ကုန်မြို့','ဆရာဝန်','၆၃၅ A (A-2) ရိုးမ ရိပ်သာ၊ ပြည်လမ်း၊ ကမာရွတ်မြို့နယ်၊ ရန်ကုန်။၊ရန်ကုန်။',4,'2024-12-10 22:14:38','2025-02-24 01:57:06'),(35,7,'မောင်ထက်မြက်သန့်စင်',86,1,1,'ရန်ကုန်မြို့','ကျောင်းသား (Hongkong University)','၆၃၅ A (A-2) ရိုးမ ရိပ်သာ၊ ပြည်လမ်း၊ ကမာရွတ်မြို့နယ်၊ ရန်ကုန်။ပ်သာ၊ ပြည်လမ်း၊ ကမာရွတ်၊ရန်ကုန်။',3,'2024-12-10 22:14:38','2025-02-24 01:57:06'),(36,7,'မောင်တိုးတက်သန့်စင်',86,1,1,'ရန်ကုန်မြို့','ကျောင်းသား (Hongkong University)','၆၃၅ A (A-2) ရိုးမ ရိပ်သာ၊ ပြည်လမ်း၊ ကမာရွတ်မြို့နယ်၊ ရန်ကုန်။',3,'2024-12-10 22:14:38','2025-02-24 01:57:06'),(38,25,'မောင်ကိုကိုသက်ကြည်နိုင်',139,1,1,'ရန်ကုန်	 	','အငယ်တန်းအင်ဂျင် နီယာ ဂျင်တိုခါနာကုမ္ပဏီ','တိုက်(၂)၊ အခန်း (၀၀၃)၊ ဝါဝါဝင်းအိမ်ရာ၊(၅)ရပ် ကွက်၊ရန်ကင်းမြို့နယ်၊ ရန်ကုန်တိုင်းဒေသကြီး။',3,'2024-12-13 03:24:02','2024-12-13 03:24:02'),(39,36,'မထက်အိန္ဒြာရွှေရည်',86,1,2,'ရန်ကုန်မြို့','ကျောင်းသူ','အမှတ်(၁)၊ သစ္စာလမ်း၊ ရန်ကင်းမြို့နယ်၊  ရန်ကုန်မြို့။  ',4,'2025-01-16 02:38:49','2025-01-16 02:38:49'),(40,36,'မခင်ဆုလာဘ်ထွန်း',86,1,2,'ရန်ကုန်မြို့','မူကြို','အမှတ်(၁)၊ သစ္စာလမ်း၊ ရန်ကင်းမြို့နယ်၊  ရန်ကုန်မြို့။  ',4,'2025-01-16 02:38:49','2025-01-16 02:38:49'),(56,50,'မောင်ဖြိုးခိုင်ဝင်း',86,1,1,'မကွေး','ကျောင်းသား','အမှတ်(၄၂)၊သစ်ခွလမ်း၊ကျောင်းကြီးစုရပ် ကွက်၊ တောင်ကြီးမြို့၊ ရှမ်းပြည်နယ်နယ်',3,'2025-01-22 01:21:20','2025-01-22 01:21:20'),(57,50,'မဝင်းနန္ဒီအောင်',86,1,2,'လွိုင်ကော်','မှီခို','အမှတ်(၄၂)၊သစ်ခွလမ်း၊ကျောင်းကြီးစုရပ် ကွက်၊ တောင်ကြီးမြို့၊ ရှမ်းပြည်နယ်',4,'2025-01-22 01:21:20','2025-01-22 01:21:20'),(58,50,'မနန်းယဉ်ထွေး',86,1,2,'တောင်ကြီး','မှီခို','အမှတ်(၄၂)၊သစ်ခွလမ်း၊ကျောင်းကြီးစုရပ် ကွက်၊ တောင်ကြီးမြို့၊ ရှမ်းပြည်နယ်',4,'2025-01-22 01:21:20','2025-01-22 01:21:20'),(59,30,'မောင်ကျော်ကောင်းထက်',86,1,1,'ရန်ကုန်','မူကြို','တိုက် B ၊ အခန်း ၂၀၄၊ သဇင်ရုံလမ်း၊ DICA အိမ်ယာ၊ မရမ်းကုန်း ၅ ရပ်ကွက်၊ မရမ်းကုန်းမြို့နယ်၊ ရန်ကုန်မြို့',3,'2025-02-26 01:51:58','2025-02-26 01:51:58'),(60,62,'မောင်ဇေယျာထွန်းလင်း',86,1,1,'ကျောက်ဆည်မြို့နယ်','ကျောင်းသား','အခန်း(၄၀၅)၊ စိမ်းလဲ့မေလမ်းသွယ်၊ DICA၊ရန်ကုန်တိုင်းဝန်ထမ်းအိမ်ရာ၊ ရန်ကင်းမြို့နယ်၊ ရန်ကုန်တိုင်းဒေသကြီး။',3,'2025-02-28 03:33:47','2025-02-28 03:33:47');
