INSERT INTO `mother_siblings` VALUES (7,8,'ဒေါ်နန်းမြအေး',103,1,1,'ပင်လုံ','မှီခို','အမှတ် (၁၃)၊ ခွာညို လမ်း၊ ရပ်ကွက် (၁)၊ ပင်လုံမြို့',8,'2024-12-08 22:37:54','2024-12-08 22:37:54'),(23,7,'(ဒေါ်ငွေယိမ်း) ၂၀၂၁',86,1,2,'လပွတ္တာ','မြို့နယ် ပညာရေးမှူး (ငြိမ်း)','၆၃၅ A(C-2)၊ ရိုးမရိပ်သာပြည်လမ်း၊ ကမာရွတ်မြို့နယ်၊ရန်ကုန်။',11,'2024-12-10 22:14:38','2025-02-24 01:57:06'),(27,21,'ဒေါ်စိုးစိုး',86,1,2,'ရန်ကုန်','ကွယ်လွန် (၂၀၂၁ ခုနှစ်)','အမှတ်(၁၂၈/ခ)၊ စပယ်မြိုင်လမ်း၊ (၁၇)ရပ်ကွက်၊ ဒဂုံမြို့သစ်(တောင်ပိုင်း) မြို့နယ်၊ ရန်ကုန်တိုင်းဒေသကြီး။',11,'2024-12-12 22:53:03','2024-12-12 22:53:03'),(29,25,'ဦးရှောကြည် ',103,4,1,'တောင်ကြီး','အင်ဂျင်နီယာချုပ်(ငြိမ်း) ',' ဆ.လ.က	အမှတ်(၁၈)၊ ဝန်ကြီးလမ်း၊ ရေအေးကွင်းရပ်၊ တောင်ကြီးမြို့',7,'2024-12-13 03:24:02','2024-12-13 03:24:02'),(99,33,'ဒေါ်ရွှေမြိုင်',86,1,2,'မြောင်မြို့နယ်၊ စစ်ကိုင်းတိုင်း ဒေသကြီး','','(၂၇-၆-၂၀၂၂) ရက်နေ့တွင် ကွယ်လွန်',11,'2025-01-10 02:30:47','2025-01-10 02:30:47'),(100,33,'ဦးမြသိန်း',86,1,1,'မြောင်မြို့နယ်၊ စစ်ကိုင်းတိုင်း ဒေသကြီး','','(၂၇-၁-၂၀၁၅) ရက်နေ့တွင် ကွယ်လွန်',10,'2025-01-10 02:30:47','2025-01-10 02:30:47'),(104,34,'ဒေါ်အုန်းကြည်',86,1,2,'အထက်ပေကုန်းကျေးရွာ၊ ဝါးခယ်မမြို့နယ်၊ ဧရာဝတီ တိုင်းဒေသကြီး။','','ကွယ်လွန် (၂၀၀၈ ခုနှစ်)',8,'2025-01-13 22:58:58','2025-01-13 22:58:58'),(105,34,'ဦးထွန်းရင်',86,1,1,'အထက်ပေကုန်းကျေးရွာ၊ ဝါးခယ်မ မြို့နယ်၊ ဧရာဝတီတိုင်း ဒေသကြီး။','','ကွယ်လွန် (၁၉၈၄ ခုနှစ်)',7,'2025-01-13 22:58:58','2025-01-13 22:58:58'),(106,34,'ဦးစန်းမြင့်',86,1,1,'အထက်ပေကုန်းကျေးရွာ၊ ဝါးခယ်မ မြို့နယ်၊ ဧရာဝတီတိုင်း ဒေသကြီး။','ဝန်ထမ်း (အငြိမ်းစား)၊ ကျန်းမာရေး ဝန်ကြီးဌာန','ကွယ်လွန် (၂၀၁၁ ခုနှစ်) ',7,'2025-01-13 22:58:58','2025-01-13 22:58:58'),(107,35,'ဒေါ်မေရီမြင့်',86,1,2,'ဂန့်ဂေါမြို့','စက်ချုပ်','အပိုင်း(၂) ၊ အေးမြသာယာ၊ မြစ်ကြီးနားမြို့',11,'2025-01-16 01:34:07','2025-01-16 01:34:07'),(108,35,'ဦးထွန်းထွန်းနိုင်',86,1,1,'မြစ်ကြီးနားမြို့','ဘဏ်ဝန်ထမ်း','အပိုင်း(၄) ၊ အေးမြသာယာ၊ မြစ်ကြီးနားမြို့',10,'2025-01-16 01:34:07','2025-01-16 01:34:07'),(109,35,'ဦးချန်ထွန်းဝင်း',86,1,1,'မြစ်ကြီးနားမြို့','မှီခို','ပမ္မတီး ရပ်ကွက်၊ 