INSERT INTO `spouse_siblings` VALUES (13,8,'ဦးကျော်မင်းထွန်း',86,1,1,'မန္တလေး','‘ကျော်ကျော် မင်းထွန်း’ ပန်းပုလုပ်ငန်း','အမှတ် ၁၀၊ ၄၇ လမ်း၊ ၈၁ လမ်းနှင့် ၈၂ လမ်းကြား၊ ကျွန်းလုံးဥသျှောင် ရပ်ကွက်၊ ချမ်းမြသာစည် မြို့နယ်၊ မန္တလေးမြို့',7,'2024-12-08 22:37:55','2024-12-08 22:37:55'),(14,8,'ဒေါ်ခင်ဆွေမြင့်',86,1,2,'မန္တလေး','‘ရွှေလမင်း’ ပန်းပုလုပ်ငန်း','အမှတ်၅/၆၊ ၄၇လမ်း၊ ၈၁ လမ်းနှင့် ၈၂ လမ်း ကြား၊ ကျွန်းလုံးဥသျှောင် ရပ်ကွက်၊ချမ်းမြသာစည် မြို့နယ်၊ မန္တလေးမြို့',8,'2024-12-08 22:37:55','2024-12-08 22:37:55'),(36,7,'ဒေါ်ခင်မြင့်',86,1,2,'ထန်းတပင်','မှီခို','အမှတ်(၁၄၀)အေးရိပ် ငြိမ်လမ်း၊သီရိရတနာ   ရပ်ကွက်၊ ထန်းတပင်မြို့။',8,'2024-12-10 22:14:38','2025-02-06 03:27:19'),(37,7,'ဒေါ်ရီရီမြင့်',86,1,2,'ထန်းတပင်','ခင်မေတ္တာ ဆီစက်','အမှတ်(၁၃၃) သဇင်လမ်း၊ အောင်ချမ်းသာရပ်ကွက်၊ ထန်းတပင်မြို့။',8,'2024-12-10 22:14:38','2024-12-10 22:14:38'),(38,7,'ဒေါ်အေးအေးမြင့်',86,1,2,'ထန်းတပင်','မှီခို','အမှတ်(၁၃/၂၄၀) ဘုရားလမ်း၊ တောင်ငူမြို့။',8,'2024-12-10 22:14:38','2024-12-10 22:14:38'),(39,7,'ဦးဇော်ဝင်း',86,1,1,'ထန်းတပင်','စားသုံးဆီ ရောင်းဝယ်ရေး လုပ်ငန်း','အမှတ်(၁) သီရိရတနာရပ်ကွက်၊ ထန်းတပင်မြို့၊ တောင်ငူမြို့။',10,'2024-12-10 22:14:38','2024-12-10 22:14:38'),(44,25,'ဒေါ်လဲ့လဲ့နိုင်',86,1,2,'ရန်ကုန်	','	မန်နေဂျာ(ရသာချိုထရေးဒင်းကုမ္ပဏီလီမိတက်)','မလိခအိမ်ရာ၊ သင်္ဃန်းကျွန်း',8,'2024-12-13 03:24:02','2024-12-13 03:24:02'),(45,25,'ဒေါ်ချစ်ချစ်ထွေး',86,1,2,'ရန်ကုန်	','မှီခို	','မလိခအိမ်ရာ၊ သင်္ဃန်းကျွန်း',11,'2024-12-13 03:24:02','2024-12-13 03:24:02'),(46,25,'ဦးသန်းကျော်မိုး',86,1,1,'ရန်ကုန်	','အရာခံဗိုလ်၊စစ်ရုံးချုပ်','မလိခအိမ်ရာ၊ သင်္ဃန်းကျွန်း',10,'2024-12-13 03:24:02','2024-12-13 03:24:02'),(47,25,'ဒု-ဗိုလ်မှူးကြီးသော်တာထွေး',86,1,1,'ရန်ကုန်	','တပ်မှူး၊စစ်ကြောရေးနှင့်တည်းခိုရေးတပ်၊ မန္တလေး	','စ.တ.ခ၊ မန္တလေး',10,'2024-12-13 03:24:02','2024-12-13 03:24:02'),(82,33,'ဒေါက်တာဝဏ္ဏဆွေ',86,1,1,'ရန်ကုန်မြို့','‘မိုး’ဆေးဆိုင် (ကိုယ်ပိုင်)','အမှတ်၄၃၊ ဗဟိုလမ်း၊ လှည်းတန်း၊ ကမာရွတ် မြို့နယ်၊ ရန်ကုန်မြို့',10,'2025-01-10 02:30:47','2025-01-10 02:30:47'),(83,36,'ဒေါ်စန္ဒာအောင် ',86,1,2,'ရန်ကုန်မြို့','ဦးစီးအရာရှိ','သ