INSERT INTO `spouses` VALUES (7,8,'ဒေါ်ရတနာမြင့်',86,1,2,'မန္တလေး','တွဲဖက်ပါမောက္ခ ပြင်သစ်ဘာသာဌာန၊ ရန်ကုန်နိုင်ငံခြား ဘာသာတက္ကသိုလ်','အခန်း(၂၀၆)၊ စိမ်းလဲ့မေ လမ်းသွယ်DICA၊ ရန်ကုန် တိုင်း၊ဝန်ထမ်းအိမ်ရာ၊ ရန်ကင်းမြို့နယ်',1,NULL,'2024-12-08 22:37:55','2024-12-08 22:37:55'),(21,7,'ဒေါ်ဝေဝေမြင့်',86,1,2,'တောင်ငူမြို့','မှီခို','၆၃၅ A (A-2) ရိုးမ ရိပ်သာ၊ ပြည်လမ်း၊ ကမာရွတ်မြို့နယ်၊ ရန်ကုန်။',1,NULL,'2024-12-10 22:14:38','2025-02-24 01:57:06'),(23,25,'ဒေါ်ကြည်ကြည်အောင်',86,1,2,'မြစ်ကြီးနား','အလယ်တန်းပြ (ငြိမ်း)','တိုက်(၂)၊အခန်း (၀၀၃)၊ ဝါဝါဝင်း အိမ်ရာ၊ (၅) ရပ် ကွက်၊ ရန်ကင်းမြို့ နယ်၊ ရန်ကုန်တိုင်း ဒေသကြီး',1,NULL,'2024-12-13 03:24:02','2024-12-13 03:24:02'),(58,33,'ဒေါ်အိအိဖြိုးဆွေ',86,1,2,'ရန်ကုန်မြို့','မှီခို','အမှတ်၄၃၊ ဗဟိုလမ်း၊ လှည်းတန်း၊ ကမာရွတ် မြို့နယ်၊ ရန်ကုန်မြို့',1,NULL,'2025-01-10 02:30:47','2025-01-10 02:30:47'),(59,36,'ဒေါ််ခင်လတ်သူ',86,1,2,'ရန်ကုန်မြို့','မှီခို','အမှတ်(၁)၊ သစ္စာလမ်း၊ ရန်ကင်းမြို့နယ်၊  ရန်ကုန်မြို့။  ',1,NULL,'2025-01-16 02:38:49','2025-01-16 02:38:49'),(70,50,'ဒေါ်နီလာဝင်း',140,1,2,'ဆီဆိုင်မြို့','မှီခို','အမှတ်(၄၂)၊သစ်ခွလမ်း၊ကျောင်းကြီးစုရပ် ကွက်၊ တောင်ကြီးမြို့၊ ရှမ်းပြည်နယ်',1,NULL,'2025-01-22 01:21:20','2025-01-22 01:23:49'),(73,53,'ဦးအောင်ကိုသက်',86,1,1,'ဒုတ်ရိုက်ကုန်းရွာ၊ မြန်အောင်မြို့နယ်၊ဧရာဝတီတိုင်း','ဝန်ထမ်း','တိုက်(ဘီ)၊ အခန်း (၄၀၃)၊ သဇင်ရုံလမ်း၊ မရမ်းကုန်းမြို့နယ်၊ ရန်ကုန်တိုင်းဒေသကြီး',2,NULL,'2025-01-28 02:55:23','2025-02-26 02:26:11'),(74,30,'ဦးကျော်ကျော်လွင်',86,1,1,'အုတ်ဖို','ဝက်မွေးမြူ‌ရေး','တိုက် B ၊ အခန်း ၂၀၄၊ သဇင်ရုံလမ်း၊ DICA အိမ်ယာ၊ မရမ်းကုန်း ၅ ရပ်ကွက်၊ မရမ်းကုန်းမြို့နယ်၊ ရန်ကုန်မြို့',2,NULL,'2025-02-26 01:51:58','2025-02-26 01:51:58'),(75,62,'ဒေါ်ခိုင်ဇာလင်း',86,1,2,'စဉ့်ကိုင်မြို့။','မှီခို','အခန်း(၄၀၅)၊ စိမ်းလဲ့မေလမ်းသွယ်၊ DICA၊ရန်ကုန်တိုင်းဝန်ထမ်းအိမ်ရာ၊ ရန်ကင်းမြို့နယ်၊ ရန်ကုန်တိုင်းဒေသကြီး။',1,NULL,'2025-02-28 03:33:47','2025-02-28 03:33:47');
