င်ရာတာဝန်ဖြင့်ပြောင်းရွှေ့တာဝန်ထမ်းဆောင် ရင်းစစ်ဘက်၊နယ်ဘက်၊ရဲဘက်၊နိုင်ငံရေးဘက်တွင်မိတ် ဆွေများနှင့် ခင်မင် ရင်းနှီးမှုရှိပါသည်။   ',2,NULL,NULL,NULL,NULL,NULL,NULL,'၂၃-၁၀-၁၉၈၇ မှ ၂၀-၇-၂၀၀၈ ရက်နေ့ထိတပ်မတော်တွင် ဒုဗိုလ်မှ ဗိုလ်မှူးအဆင့်ထိ တာဝန်ထမ်းဆောင်ခဲ့ပါသည်။ \n\n၂၁-၅-၂၀၀၈မှ၂၅-၉-၂၀၀၉ရက်နေ့ထိဒုတိယညွှန်ကြားရေးမှူး တာဝန်နှင့်၂၆-၉-၂၀၀၉မှ၂၄-၃-၂၀၁၅ရက်နေ့ထိဗဟိုစက်ပစ္စည်း စာရင်းအင်းနှင့်စစ်ဆေးရေးဦးစီးဌာနတွင်ညွှန်ကြားရေးမှူး တာဝန်များကိုတာဝန်ထမ်းဆောင်ခဲ့ပါသည်။ \n\n၂၅-၃-၂၀၁၅မှ၁၇-၃-၂၀၁၆ရက်နေ့ထိအမျိုးသားစီမံကိန်း နှင့်စီးပွားရေးဖွံ့ဖြိုးတိုးတက်မှုဝန်ကြီးဌာနတွင်ဒုတိယ  အမြဲတမ်းအတွင်းဝန်အဖြစ်တာဝန်ထမ်းဆောင်ခဲ့ပါသည်။  \n\n၂၂-၃-၂၀၁၆မှ၂-၁-၂၀၁၉ရက်နေ့ထိရင်းနှီးမြှုပ်နှံမှုနှင့်ကုမ္ပဏီများ ညွှန်ကြားမှုဦးစီးဌာနတွင်ဒုတိယညွှန်ကြားရေးမှူးချုပ်အဖြစ် တာဝန်ထမ်းဆောင်ခဲ့ပါသည်။\n\n၃-၁-၂၀၁၉မှ၂-၄-၂၀၁၉ထိဒုတိယအမြဲတမ်းအတွင်းဝန်၊ ရင်းနှီးမြှုပ်နှံမှုနှင့်နိုင်ငံခြားစီးပွားဆက်သွယ်ရေးဝန်ကြီးဌာန၊ ပြည်ထောင်စုဝန်ကြီးရုံးတွင်တာဝန်ထမ်းဆောင်ခဲ့ပါသည်။ \n\n၃-၄-၂၀၁၉မှ၂၄-၇-၂၀၁၉ထိရင်းနှီးမြှုပ်နှံမှုနှင့်ကုမ္ပဏီများ  ညွှန်ကြားမှုဦးစီးဌာနတွင်ခေတ္တညွှန်ကြားရေးမှူးချုပ်အဖြစ် တာဝန်ထမ်းဆောင်ခဲ့ပါသည်။\n\n၂၅-၇-၂၀၁၉မှယနေ့ထိရင်းနှီးမြှုပ်နှံမှုနှင့်ကုမ္ပဏီများညွှန်ကြားမှု ဦးစီးဌာနတွင်ညွှန်ကြားရေးမှူးချုပ်အဖြစ်တာဝန်ထမ်းဆောင် လျက်ရှိပါသည်။'),(8,'staffs/cuzcQrRIj6RLyu9cG5NBvsgHTEVpI0tQR5iRDXZL.jpg',NULL,'ဦးစိုးမြင့်အောင်',NULL,NULL,'1981-04-14','3A002','GPMS Code-00822','ဒေါ်ရတနာမြင့်',1,136,1,5,8,'အနက်','အနက်','ဝဲပါးမှဲ့ရှိ','အဖြူ','၁၅၀ပေါင်',1,6,'အင်းလေး၊ ညောင်ရွှေမြို့နယ်',13,386,1,'၀၄၉၀၇၃',NULL,NULL,'၀၉၂၆၃၈၀၆၆၆၇','၀၉၂၆၃၈၀၆၆၆၇','soemyintaung.moc@gmail.com',NULL,NULL,NULL,'စိမ်းလဲ့မေလမ်းသွယ်၊',NULL,'အခန်း(၂၀၆)၊ DICA၊ ရန်ကုန် တိုင်းဝန်ထမ်းအိမ်ရာ၊ ',216,NULL,13,'ကျီတော်လမ်း','ကျီတော်ရပ်ကွက်','အမှတ် (၂၉)၊ ',220,NULL,13,'ဆည်ခေါင်းရွာ၊ ညောင်ရွှေမြို့။','ရေ-၄၁၄၂','1999-05-28','စစ်တက္ကသိုလ်၊ အမှတ်စဉ်(၄၄)၊ ဗိုလ်လောင်းသင်တန်း',NULL,NULL,NULL,'2002-04-05','2006-08-16','နယ်ဘက်တာဝန်ပြောင်းလဲထမ်းဆောင်ခြင်း','အမှတ်(၁) ဗျူဟာစစ်ရေယာဉ်စု၊ ရေတပ်ပင်မတိုင်းတာ ရေးတပ်၊ အမှတ် (၃၆)၊ စစ်ရေယာဉ်စု။','မရှိပါ။','139,400',NULL,NULL,NULL,NULL,NULL,NULL,'ဦ